import React, { Component } from "react";

export default class Landing extends Component {
  render() {
    return (
      <div>
        <p className="intro">
          I have come to realise I tend to make things that forces the user to
          engage. Either with me, with others or with an interface. This has
          come to be one of the main topics for my thesis. Friction. I think its
          good to implement friction. If we have to think a little, I think we
          get a stronger relation to the content. I like to compare this with
          asking a professor for help in an assignment. Would you want them to
          give you the answer right away? or would you rather having them point
          you in the right direction, give you some small breadcrumbs and let
          you figure out the answer yourself?
        </p>
      </div>
    );
  }
}
